webstoreListingDescription.message:
Įdiekite AudD plėtinį ir spustelėkite jo piktogramą, kad nustatytumėte dainą, grojamą dabartiniame skirtuke.
Žiūrėkite aukščiau esantį vaizdo įrašą, kad sužinotumėte, kaip tai veikia.

AudD plėtinys:
- Atpažįsta jūsų naršyklėje grojamą muziką;
- Suranda muziką AudD duomenų bazėje su daugiau nei 75 milijonais dainų, naudodamas savo muzikos atpažinimo technologiją;
- Rodo identifikuotų dainų žodžius;
- Rodomos nuorodos, leidžiančios klausytis dainų „Apple Music“, „Spotify“, „Deezer“, „YouTube Music“;
- Rodo tikslų atpažintos dainos momentą, kai grojamas garsas iš naršyklės.

Muzikos atpažinimo API: https://audd.io
Šaltinio kodas: https://github.com/AudDMusic/chrome-extension

Plėtinys, kurį palaiko AudD® muzikos atpažinimo API

Sukūrė ir sukūrė AudD.io komanda, padedama Erico Starko, Mitchell Kossoris ir Ivan Kasatkin.
